import { BrowserRouter, Routes, Route } from "react-router-dom";
import { About } from "./pages/About"
import { Projects } from "./pages/Projects"

const TheRoutes = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/about">
                    <About />
                </Route>
                <Route path="/projects">
                    <Projects />
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default TheRoutes;
